Carolina Coronado (1820-1911) fue una poeta romántica española que escribió este soneto titulado "Ascensión". El poema refleja temas típicos del Romanticismo como la búsqueda de la altura, tanto física como espiritual, y la relación del individuo con la naturaleza y las aspiraciones sublimes.
